import React, { Component } from 'react'

export default class Login extends Component {
  render() {
    return (
      <div data-testid="page-login">
        <form>
          <label htmlFor='inputName'>Nome: </label>
          <input type='text' data-testid="login-name-input" id='inputName'/>


        </form>
      </div>
    )
  }
}
